import request from '@/utils/request';
import { host } from "./utils";
export function createSubscribe(data) {
  return request({
    url: host + '/api/subscribe/add',
    method: 'post',
    data: data
  });
}
export function getSubscribeCount(params) {
  return request({
    url: host + '/api/subscribe/count',
    method: 'get',
    params: params
  });
}
export function getSubscribeList(params) {
  return request({
    url: host + '/api/subscribe/list',
    method: 'get',
    params: params
  });
}
